import React, { useState, useEffect } from 'react';

import axios from 'axios';

function App() {
    const [data, setData] = useState(null);

    useEffect(() => {
        axios.get('https://coronavirus-tracker-api.herokuapp.com/all')
            .then(result => {
                setData(result.data)
            })
    })

    console.log(data);

    return (
    <div>
      <h1>CORONA</h1>

    </div>
    );
}

export default App;
